import * as React from "react"

import {
 Dashboard,
 HomePage
} from "./pages"
import {
  Route,
  BrowserRouter as Router,
} from "react-router-dom"

import { SdkProvider } from "./services/client/wallet"
import { config } from "../config";
import theme from "./theme"

export const App = () => (

  <Router>

      <Route
        exact
        path="/"
        component={HomePage}
      />

      <Route
        exact
        path="/dashboard"
        component={Dashboard}
      />

    </Router>

);
